axial = 0;

% ROI
nx = 8;    % Кол-во точек вдоль Х
ny = 8;    % Кол-во точек вдоль Y
nz = 8;    % Кол-во точек вдоль Z
K = nx*ny*nz;  % Полное число точек ROI

lx = 0.066;  % Длина области вдоль Х
ly = 0.066;  % Длина области вдоль Y
lz = 0.066;  % Длина области вдоль Z

