level = -0.004714285714286;  % Положение плоскости
plane = 0;  % Выбор плоскости 0)XY, 1)XZ, 2)YZ

%% ------------------------------------------------------------------------- % Создание массива узлов

N = nfi*nL; % Количество узлов

Node1 = CreateNode(R1, L, nfi, nL, axial); % Создание массива узлов №1
Node2 = CreateNode(R2, L, nfi, nL, axial); % Создание массива узлов №2

%% ------------------------------------------------------------------------- Создание массива треугольных элементов

S1 = CreateS(N, nfi); % Создание массива элементов №1 
S2 = CreateS(N, nfi); % Создание массива элементов №2


%% ------------------------------------------------------------------------- % Создание массива ROI

ROI = CreateROI(nx, ny, nz, lx, ly, lz, CenterROI);

%% ------------------------------------------------------------------------- % Отрисовка сетки

PointWebROI(Node1, S1, ROI)

%% ------------------------------------------------------------------------- % Задание целевого поля

Bdes = abs(ROI(:,1)).*ROI(:,1); % Вычисление целевого поля

TargetField(lx, ly, lz, nx, ny, nz, Bdes, level, plane);

