function Node = CreateNode(R, L, nfi, nL, axial) % Создание массива узлов
    Node = zeros(nfi,3); % Сетка
    Temp = zeros(nfi,3); 

    f = linspace(-pi+2*pi/nfi,pi,nfi); % Массив значений угла
    l = linspace(-L,L,nL); % Массив значений длины

    Node(:,1) = l(1);      % X
    Node(:,2) = R*sin(f);  % Y
    Node(:,3) = R*cos(f);  % Z

    for i = 2:nL
        Temp(:,1) = l(i); % X
        Temp(:,2) = R*sin(f); % Y        
        Temp(:,3) = R*cos(f); % Z
        Node = [Node; Temp];
    end

    if axial
        Node = rotY(Node, pi/2); % Поворот катушки
    end
end

function S = CreateS(N, nfi) % Создание массива элементов

    S = zeros(N,1);             % Массив элементов (хранится информация о номерах узлов, составляющих элемент)
    i = 1;
    while i <= N-nfi            % Заолнение массива элементов     
        if mod(i,nfi) ~= 0 
            S(2*i-1,1) = i;     % По два треугольника в одном квадрате
            S(2*i-1,2) = i+nfi;
            S(2*i-1,3) = i+nfi+1;
            S(2*i,1) = i;
            S(2*i,2) = i+nfi+1;
            S(2*i,3) = i+1;
        else                    % Последние элементы в кольце
            S(2*i-1,1) = i;     % По два треугольника в одном квадрате
            S(2*i-1,2) = i+nfi;
            S(2*i-1,3) = i+1;
            S(2*i,1) = i;
            S(2*i,2) = i+1;
            S(2*i,3) = i-nfi+1;
        end
        i = i + 1;
    end
    
end

function ROI = CreateROI(nx, ny, nz, lx, ly, lz, CenterROI) % Создание массива ROI
    ROI = [];
    dy = ly/(ny-1);
    dz = lz/(nz-1);
    for j = 1:nz
        z = -lz/2+(j-1)*dz;
        for i = 1:ny
            y = -ly/2+(i-1)*dy;
            Temp = [transpose(linspace(-lx/2,lx/2,nx))+CenterROI(1) y*ones(nx,1)+CenterROI(2) z*ones(nx,1)+CenterROI(3)];
            ROI = [ROI; Temp];
        end
    end
end

function PointWebROI(Node, S, ROI) % Отрисовка точек, элементов и ROI
    % n = 25;
    %Si = N2T(n, S); 

    figure('Name','Сетка','NumberTitle','off'); 
    movegui([0 560]);
    plot3(Node(:,1),Node(:,2),Node(:,3),'b.'); % Отрисовка узлов
    hold on
    xlabel ('x [m]'), ylabel ('y [m]'), zlabel ('z [m]')
    axis equal
    grid on 
    %plot3(Node(S(Si,:),1),Node(S(Si,:),2),Node(S(Si,:),3),'g*'); % Отрисовка элемента (N2T) 
    for i = 1:length(S(:,1))
        plot3(Node(S(i,:),1),Node(S(i,:),2),Node(S(i,:),3),'r-'); % Отрисовка сетки
    end
    plot3(ROI(:,1),ROI(:,2),ROI(:,3),'k.'); % Отрисовка ROI
    
end

function TargetField(lx, ly, lz, nx, ny, nz, Bdes, level, plane) % Отрисовка целевого поля
    
    [X,Y,Z,B] = Transform3D(lx, ly, lz, nx, ny, nz, Bdes); % Для отрисовки поля

    figure('Name','Целевое поле','NumberTitle','off'); 
    movegui([570 560]);
    if (plane == 0) % ---------------------------------------------------------- XY
        k = find(abs(Z(1,1,:)-level) < 0.00001);
        surf(X(:,:,k), Y(:,:,k), B(:,:,k))
        xlabel ('x [m]'), ylabel ('y [m]'), title(strcat('Bz [T], z = ', num2str(level))) 
    elseif (plane == 1) % ------------------------------------------------------ XZ 
        k = find(abs(Y(1,:,1)-level) < 0.00001);
        XX = reshape(X(:,k,:),[nx,nz,1]);
        ZZ = reshape(Z(:,k,:),[nx,nz,1]);
        BB = reshape(B(:,k,:),[nx,nz,1]);
        surf(XX, ZZ, BB)
        xlabel ('x [m]'), ylabel ('z [m]'), title(strcat('Bz [T], y = ', num2str(level)))
    elseif (plane == 2) % ------------------------------------------------------ YZ
        k = find(abs(X(:,1,1)-level) < 0.00001);
        YY = reshape(Y(k,:,:),[ny,nz,1]);
        ZZ = reshape(Z(k,:,:),[ny,nz,1]);
        BB = reshape(B(k,:,:),[ny,nz,1]);
        surf(YY, ZZ, BB)
        xlabel ('y [m]'), ylabel ('z [m]'), title(strcat('Bz [T], x = ', num2str(level)))
    else
        disp('___ОШИБКА ВЫБОРА ПЛОСКОСТИ___');
    end
    colorbar
    box on
    grid on 
    
end

function I = ABI(N, Node, S, ROI, ro, t, alpfa, betta, Bdes) % Вычисление матрицы коэффициентво

    % Задание матрицы А
    A = zeros(N,N);
    parfor j = 1:N
        for i = 1:N
            bz1 = Calcbz(i, S, Node, ROI);
            bz2 = Calcbz(j, S, Node, ROI);
            Lmn = CalcLmn(i, j, S, Node);
            pmn = CalcPmn(i, j, ro, t, S, Node);
            Arr = bz1.*bz2;
            A(i,j) = zum(Arr) + alpfa*Lmn + betta*pmn;
        end
    end

    clear Temp bz1 bz2

    % Задание матрицы B

    B = zeros(N,1);

    for i = 1:N
        bz1 = Calcbz(i, S, Node, ROI);
        Arr = Bdes(:,1).*bz1;
        B(i,1) = zum(Arr);
    end 

    I = pinv(A)*B;

end

function StreamFunctionGrad(L, nfi, nL, I) % Отрисовка потоковой функции и градиента п.ф.

    [Fi, Ll, II] = Transform2D(L, nfi, nL, I);
    [px,py] = gradient(II);
    p=max(max(sqrt(px.^2+py.^2)));
    px = px/(p);
    py = py/(p);
    
    figure('Name','Потоковая функция','NumberTitle','off'); 
    movegui([1145 560]);
    contourf(Fi,Ll,II);
    box on
    hold on
    quiver(Fi,Ll,px,py,0.2,'*r', 'MarkerSize', 3, 'LineWidth', 1)
    xlabel('fi'), ylabel('L'), title('Stream Function')
    colorbar

end

function Elements(I, S, Node) % Отрисовка элементов
    
    rgb = ones(length(S(:,1)),3);
    
    StFun = zeros(length(S(:,1)),1);

    for i = 1:length(S(:,1))
        StFun(i,1) = (I(S(i,1),1) + I(S(i,2),1) + I(S(i,3),1))/3; 
    end
    
    StFun = StFun - min(min(StFun));
    StFun = 0.6667*StFun/max(max(StFun));
    
    for i = 1:length(S(:,1))
        rgb(i,:) = hsv2rgb([StFun(i,1) 1 1]);
    end
    
    figure('Name','Элементы','NumberTitle','off'); 
    movegui([0 30]);
    x = [Node(S(1,1),1) Node(S(1,2),1) Node(S(1,3),1)];
    y = [Node(S(1,1),2) Node(S(1,2),2) Node(S(1,3),2)];
    z = [Node(S(1,1),3) Node(S(1,2),3) Node(S(1,3),3)];
    fill3(x, y, z,rgb(1,:))
    hold on
    xlabel ('x [m]'), ylabel ('y [m]'), zlabel ('z [m]')
    axis equal
    grid on
    for i = 2:length(S(:,1))
        x = [Node(S(i,1),1) Node(S(i,2),1) Node(S(i,3),1)];
        y = [Node(S(i,1),2) Node(S(i,2),2) Node(S(i,3),2)];
        z = [Node(S(i,1),3) Node(S(i,2),3) Node(S(i,3),3)];
        fill3(x, y, z,rgb(i,:)) % Отрисовка элементов
    end
end

function [Bz, DES] = ReceivedField(I, K, N, S, Node, ROI, Bdes) % Расчет и отрисовка полученного поля

    Bz = zeros(K,1);
    Temp = 0;
    for j = 1:N
        b = Calcbz(j, S, Node, ROI);
        Temp = Temp + I(j,1)*b;
    end
    Bz(:,1) = Temp;
    
    DES = abs(Bdes - Bz);
    
end

